import { Button, Space, Form } from 'antd';
import React from 'react';
import { useParams } from 'react-router-dom';

const Exam = () => {
	const userId = localStorage.getItem('userId');
	const { id } = useParams();
	return (
		<Form>
			<Space>
				<Form.Item></Form.Item>
				<Form.Item>
					<Button>Submit</Button>
				</Form.Item>
			</Space>
		</Form>
	);
};
export default Exam;
